export const IndivShoe = () => {
    const { url } = useParams();
    let allShoes = [...women, ...men];

    return (
        <div className="item">
            {allShoes.filter(shoe => shoe.url === url).map((shoe, index) => (
                <div key={index} className="indiv-shoe-container">
                    <div className="indiv-shoe-image">
                        <img src={shoe.image} alt={shoe.name} />
                    </div>
                    <div className="text-info">
                        <h2>{shoe.name}</h2>
                        <p className="price">${shoe.price}</p>
                        <p className="description">{shoe.description}</p>
                    </div>
                </div>
            ))}
        </div>
    );
}
